import './Homepage.css';

function Option() {
    //Create image and option list
    const imgList = []
    const optionList = ['Create JIRA Story','Host Daily Standup','Host Retro']

    //Rendered the homepage list item
    const renderedItmes = optionList.map((item, index) => (
        <div>
            <div className="option" key={index}>{item}</div>
        </div>
    ));

    return(
        <div>
            {renderedItmes}
        </div>
    );
}

export default function Homepage() {
    return (
        <div>
            <h1>AGILE TOOL</h1>
            <div></div>
            <Option />
        </div>
    );
}
